                current_directory = directory
            else:
                current_directory = current_directory + '/' + directory if current_directory != '/' else '/' + directory
        elif command.startswith('./'):
            file = command[2:]
            output.append(f'Executing {file}...')
        elif command == 'pwd':
            output.append(current_directory)
    return output

